import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import '../css/carousel.css';
const assets = require('../imgs/personalAssets.png');


class MainCarousel extends React.Component {


  render () {
    return (
      <div>
        {/*<Carousel indicators='true'>*/}
          {/*<Carousel.Item>*/}
            {/*<Jumbotron style={{backgroundColor: '#F2F2F2'}}>*/}
              {/*<Row className="justify-content-md-center">*/}
                {/*<Col lg='5'>*/}
                  {/*<img src={assets} style={{width: '100%'}}/>*/}
                {/*</Col>*/}
                {/*<Col lg='5' className="align-self-start" style={{marginTop: '1em', alignContent: 'space-between'}}>*/}

                    {/*<h5 style={{color: '#FD9D2E'}}>STEP ONE</h5>*/}
                    {/*<h2 style={{color: '#8E959B', fontWeight: 200}}>Register and Link Accounts</h2>*/}
                  {/*<div style={{width: '90%'}}>*/}
                    {/*<p style={{color: '#5C6670'}}>*/}
                    {/*Connect all of your external financial accounts (IRAs, 401ks, mortgages, loans, checking & savings) and get a comprehensive view of your money. Once you have linked your accounts, schedule a free consultation* with a Personal Capital Advisor.*/}
                    {/*</p>*/}
                    {/*<p>*/}
                    {/** Personal Capital offers wealth management services for a fixed fee. Learn more &raquo;*/}
                    {/*</p>*/}
                  {/*</div>*/}
                {/*</Col>*/}
              {/*</Row>*/}
            {/*</Jumbotron>*/}
          {/*</Carousel.Item>*/}
          {/*<Carousel.Item>*/}
            {/*<Jumbotron style={{backgroundColor: '#F2F2F2'}}>*/}
              {/*<Row className="justify-content-md-center">*/}
                {/*<Col lg='5'>*/}
                  {/*<img src={assets} style={{width: '100%'}}/>*/}
                {/*</Col>*/}
                {/*<Col lg='5' className="align-self-start" style={{marginTop: '1em', alignContent: 'space-between'}}>*/}

                  {/*<h5 style={{color: '#FD9D2E'}}>STEP ONE</h5>*/}
                  {/*<h2 style={{color: '#8E959B', fontWeight: 200}}>Register and Link Accounts</h2>*/}
                  {/*<div style={{width: '90%'}}>*/}
                    {/*<p style={{color: '#5C6670'}}>*/}
                      {/*Connect all of your external financial accounts (IRAs, 401ks, mortgages, loans, checking & savings) and get a comprehensive view of your money. Once you have linked your accounts, schedule a free consultation* with a Personal Capital Advisor.*/}
                    {/*</p>*/}
                    {/*<p>*/}
                      {/** Personal Capital offers wealth management services for a fixed fee. Learn more &raquo;*/}
                    {/*</p>*/}
                  {/*</div>*/}
                {/*</Col>*/}
              {/*</Row>*/}
            {/*</Jumbotron>*/}
          {/*</Carousel.Item>*/}
          {/*<Carousel.Item>*/}
            {/*<Jumbotron style={{backgroundColor: '#F2F2F2'}}>*/}
              {/*<Row className="justify-content-md-center">*/}
                {/*<Col lg='5'>*/}
                  {/*<img src={assets} style={{width: '100%'}}/>*/}
                {/*</Col>*/}
                {/*<Col lg='5' className="align-self-start" style={{marginTop: '1em', alignContent: 'space-between'}}>*/}

                  {/*<h5 style={{color: '#FD9D2E'}}>STEP ONE</h5>*/}
                  {/*<h2 style={{color: '#8E959B', fontWeight: 200}}>Register and Link Accounts</h2>*/}
                  {/*<div style={{width: '90%'}}>*/}
                    {/*<p style={{color: '#5C6670'}}>*/}
                      {/*Connect all of your external financial accounts (IRAs, 401ks, mortgages, loans, checking & savings) and get a comprehensive view of your money. Once you have linked your accounts, schedule a free consultation* with a Personal Capital Advisor.*/}
                    {/*</p>*/}
                    {/*<p>*/}
                      {/** Personal Capital offers wealth management services for a fixed fee. Learn more &raquo;*/}
                    {/*</p>*/}
                  {/*</div>*/}
                {/*</Col>*/}
              {/*</Row>*/}
            {/*</Jumbotron>*/}
          {/*</Carousel.Item>*/}
        {/*</Carousel>*/}
        <Carousel>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={assets}
              alt="First slide"
            />
            <Carousel.Caption>
              <h3>First slide label</h3>
              <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={assets}
              alt="Third slide"
            />

            <Carousel.Caption>
              <h3>Second slide label</h3>
              <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={assets}
              alt="Third slide"
            />

            <Carousel.Caption>
              <h3>Third slide label</h3>
              <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
            </Carousel.Caption>
          </Carousel.Item>
        </Carousel>
      </div>
    );
  }
}

export default MainCarousel;
